import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import "./SignIn/SignIn.css";
import "./pages.css";
import NavBar from "./navbar/NavBar";
import space from './space.jpg';
import cover from './cover.PNG';
import two from './two.PNG';
import three from './three.PNG';
import four from './four.PNG';
//import five from './five.PNG';
//import six from './six.PNG';
import seven from './seven.PNG';
import eight from './eight.PNG';
import nine from './nine.PNG';

class Home extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

changeRoute = (newRoute) => {
  this.props.changeRoute(newRoute);
}
loadUser = (data) =>{
  this.props.loadUser(data);
}

  render() {
    return (
      <div>
        <NavBar changeRoute={this.changeRoute} />

        <div className="tc">
          <br />
          <br />
          <br />
          <h1 className="tc white i f1 font">Our presentation </h1>
          <br />
          <br />
          <Container>
            <Row>
           
              <Col className="tc f3 solidBR">
                  Slide 1: Introduction
               <hr />
                <div className="tl f3 i">
                
             
    
              
              <br/>
                <Row>
                 

                  <Col className= 'tc f3 solidBR'>
                    <img src={cover} alt="yes" />
                  
                  </Col>
                </Row>
                <br/>
                <br/>
                <Row>


              

                  <Col className= 'tc f3 solidBR'>
                  Slide 2: Overview
                  <hr/>
                    <img src={two} alt="yes" />
                  </Col>

                  
                </Row>
      
              <br/>
         
              <br/>
              <br/>
              <br/>
              <br/>
              <br/>
                  <br/>               
                </div>
              </Col>
              </Row>

              <br/>
              <br/>
              <br/>
              <br/>
              <br/>

              

          </Container>
          <br/>
          <br/>
        </div>
        </div>
    );
  }
}

export default Home;
